import React from 'react';
import './Card.css';
export default function Card(props){
    return(
        <>
        <div className="s-card" >
           <div className="c-img">
               <img src={props.image} alt="" />
           </div>
           <div className="c-title" >
               {props.title}
           </div>
           <div className="c-des">
               {props.des}
           </div>
        </div>
        </>
    )
}
